;; **
;;; Let's see how things converge. Compute average number of aircraft from the beginning to the current sample:
;; **

;; @@
(defn nas-avg
     [nas]
     (loop [an []
            sum 0.
            n 0
            nas nas]
       (if-let [[na & nas] (seq nas)]
         (let [sum (+ sum na)
               n (inc n)]
           (recur (conj an (/ sum n)) sum n nas))
         an)))

(def avg-nas-beg
  "average number of aircraft from beginning to the current sample"
  (nas-avg nas))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;aircraft/avg-nas-beg</span>","value":"#'aircraft/avg-nas-beg"}
;; <=

;; @@
(list-plot avg-nas-beg :color "#00cccc" 
           :plot-range [[0 N] [0 10]]
           :joined true
           :y-title "Number of Aircraft"
           :x-title "MH Iterations")
